Our naïve singly-linked stack is composed of a public structure List storing the head of the list, an enum Link representing either an empty list or a heap-allocated Node storing the payload—an integer—and the link to the next node: pub struct List { head: Link,
} enum Link { Empty, More(Box<Node>),
} struct Node { elem: i32, next: Link,
}
# # fn main() {
# let test = Node {
# elem: 17,
# next: Link::Empty,
# };
# # if test.elem > 23 {
# panic!() // unreachable
# }
# }
// Prusti: VERIFIES As explained in the chapter 2.1: Basic Data Layout , this design avoids making both Link and Node public. Moreover, it benefits from the Rust compiler's null-pointer optimization and makes sure that all list elements are uniformly allocated on the heap.

