Prusti automatically checks that no statement or macro that causes an explicit runtime error, such as panic! , unreachable! , unimplemented! , todo! , or possibly a failing assertion , is reachable. Prusti assertions are also checked. These are like the normal assert! statements, but they can use the full Prusti specification syntax and will not result in any runtime checks or code when compiled normally. For example, the following test function creates a node with no successor and panics if the node's payload is greater than 23: # pub struct List {
# head: Link,
# }
# # enum Link {
# Empty,
# More(Box<Node>),
# }
# # struct Node {
# elem: i32,
# next: Link,
# }
# fn main() { let test = Node { elem: 17, next: Link::Empty, }; if test.elem > 23 { panic!() // unreachable }
}
// Prusti: VERIFIES Prusti successfully verifies the above function because it can statically guarantee that test.elem <= 23 holds whenever execution reaches the if statement. This is not the case for the following function in which the test node is initialized with an arbitrary integer: # pub struct List {
# head: Link,
# }
# # enum Link {
# Empty,
# More(Box<Node>),
# }
# # struct Node {
# elem: i32,
# next: Link,
# }
# # fn main() {
# let test = Node {
# elem: 17,
# next: Link::Empty,
# };
# # if test.elem > 23 {
# panic!() // unreachable
# }
# }
# fn test(x: i32) { let test = Node { elem: x, // unknown value next: Link::Empty, }; if test.elem > 23 { panic!() //~ ERROR panic!(..) statement might be reachable }
}
// Prusti: FAILS Prusti reports errors in the same fashion as the Rust compiler (with the prefix Prusti: verification error). For example, the error produced for the above function is: error: [Prusti: verification error] statement might panic --> getting_started_failing.rs:33:9 |
