In our case, the function std::mem::replace is neither marked as pure nor does it come with a specification. Hence, Prusti assumes that it is memory safe and nothing else. That is, Prusti uses true as both pre- and postcondition of replace, which is too weak to prove the specification of push. According to its specification, replace could arbitrarily change the original list and thus also its length. Hence, we cannot conclude that the length the list returned by replace(&mut self.head, Link::Empty) coincides with the length of the original list. We can remedy this issue by strengthening the specification of replace. In this tutorial, we will assume that the standard library is correct, that is, we do not attempt to verify specifications for functions in external crates, like replace. To this end, we have to add the specification to the function. This can be done with another piece of Prusti syntax, the extern_spec : # // The next line is only required for doctests, you can ignore/remove it
# extern crate prusti_contracts;
# use prusti_contracts::*;
# # fn main() {}
# # pub struct List {
# head: Link,
# }
# # enum Link {
# Empty,
# More(Box<Node>),
# }
# # struct Node {
# elem: i32,
# next: Link,
# }
# #[extern_spec(std::mem)]
#[ensures(snap(dest) === src)]
#[ensures(result === old(snap(dest)))]
fn replace<T>(dest: &mut T, src: T) -> T;
# # impl List {
# #[ensures(self.len() == old(self.len()) + 1)] // 1. Property
# pub fn push(&mut self, elem: i32) {
# let new_node = Box::new(Node {
# elem,
# next: std::mem::replace(&mut self.head, Link::Empty),
# });
# # self.head = Link::More(new_node);
# }
# # #[pure]
# pub fn len(&self) -> usize {
# self.head.len()
# }
# # #[ensures(result.len() == 0)]
# pub fn new() -> Self {
# List { head: Link::Empty }
# }
# }
# # impl Link {
# #[pure]
# fn len(&self) -> usize {
# match self {
# Link::Empty => 0,
# Link::More(node) => 1 + node.next.len(),
# }
# }
# # #[pure]
# fn is_empty(&self) -> bool {
# matches!(self, Link::Empty)
# }
# } Let's break this snippet down step by step: First, we write the Prusti annotation #[extern_spec] to denote that we are writing an external specification. This requires prusti_contracts::* to be imported first. Next, we need to declare where the original function is located. In this case it is the module std::mem, so we put its path in the parameter: #[extern_spec(std::mem)] After a quick search for "rust std mem replace" we can find the documentation for std::mem::replace . Here we can get the function signature: pub fn replace<T>(dest: &mut T, src: T) -> T. We then write down the signature in the inner module, followed by a ;. Since there are no preconditions to replace, we can use the (implicit) default #[requires(true)]. For writing the postcondition, we use four pieces of Prusti syntax: === is called snapshot equality or logical equality . Is means that the left and right operands are structurally equal. === does not require the type of the compared elements to implement PartialEq , which would be required if we used the standard equality operator ==. The snap() function takes a snapshot of a reference. It has a similar functionality to the clone() method, but does not require the type of the reference it is called on to implement the Clone trait. snap should only be used in specifications, since it ignores the borrow checker. Lastly, we have the old() function , which denotes that we want to refer to the state of snap(dest) from before the function was called. The identifier result is used to refer to the return parameter of the function. The postcondition consists of two parts, which can either be written in one condition with &&, or in multiple #[ensures(...)] annotations like in the example above. The first condition snap(dest) === src means: After the function returns, the location referenced by dest is structurally equal to the parameter src The second part of the postcondition is result === old(snap(dest)). This means: The result returned by the function is structurally equal to the the element that was referenced by dest before the function was called. Since result is structurally equal to dest from before the function call, Prusti knows that the pure function len() called on result returns the same value as it would have for dest. An important thing to note here is that Prusti does not check if replace actually does what the external specification says it does. #[extern_spec] implicitly implies the #[trusted] annotation, which means that any postconditions are just accepted and used by Prusti.

