As mentioned above, extern_specs are implicitly #[trusted] by Prusti. Trusted functions can be used for verifying projects containing external code that does not have Prusti annotations, or projects using Rust features that are not yet supported by Prusti. An example is printing a string slice (not supported yet): # // The next line is only required for doctests, you can ignore/remove it
# extern crate prusti_contracts;
# use prusti_contracts::*;
# #[trusted]
fn print(s: &str) { println!("{s}");
} Prusti will not check trusted functions for correctness, so it is the programmers responsibility to check their the specification manually. A single incorrect specification of a trusted function can invalidate the correctness of Prusti as a whole! Hence, trusted functions, like unsafe Rust code, need to be treated carefully and require external justification. For example, the following function will not cause the verification to fail: # // The next line is only required for doctests, you can ignore/remove it
# extern crate prusti_contracts;
# use prusti_contracts::*;
# #[trusted]
fn incorrect_function() -> i32 { panic!()
} This one is even worse, it will enable anything to be verified: # // The next line is only required for doctests, you can ignore/remove it
# extern crate prusti_contracts;
# use prusti_contracts::*;
#
#[trusted]
#[ensures(false)]
fn wrong() {}

