The specification for a function could have a precondition that is too restrictive. If you never use the function in another verified function, you may not notice this: # // The next line is only required for doctests, you can ignore/remove it
# extern crate prusti_contracts;
# use prusti_contracts::*;
# # fn main() {}
# #[requires(x == 10)] // Restrictive precondition
#[ensures(result == x * x)]
pub fn restrictive_square(x: i32) -> i32 { x * x
} fn test() { assert!(restrictive_square(10) == 100); // Works assert!(restrictive_square(5) == 25); //~ ERROR precondition might not hold.
} This function is correct (ignoring potential overflows), but it is not useful, since the input must be 10. Another potential problem could be an incomplete postcondition. The abs function below should return the absolute value of x, but it only works for positive values. The verification will still succeed, because the postcondition does not specify the result for x < 0: # // The next line is only required for doctests, you can ignore/remove it
# extern crate prusti_contracts;
# use prusti_contracts::*;
# # fn main() {}
# #[pure]
// Note that a postcondition is not actually needed here, since `abs` is #[pure]
#[ensures(x >= 0 ==> result == x)]
pub fn abs(x: i32) -> i32 { x
} fn test_abs() { prusti_assert!(abs(8) == 8); // Works prusti_assert!(abs(-10) == 10); //~ ERROR the asserted expression might not hold
} This bug will be noticed as soon as you try using abs with a negative input. For functions internal to a project, you will likely notice mistakes in the specification when you try to use the function in other code. However, when you have public functions, like for example in a library, you might want to write some test functions for your specification. Specification errors sometimes only show up when they are actually used.

