Recommended reading: 3.2: Generic Just like the corresponding chapter in the "Learning Rust With Entirely Too Many Linked Lists" book, we will change our list to have a generic element type T, not just i32. For this, we go through our code an add the generic parameter T where required. The compiler really helps for this, since it will mark where a generic parameter is needed. If you do this process with Prusti, at some point you will encounter the following error: [E0369] binary operation `==` cannot be applied to type `T`. This is because the generic type T might not implement PartialEq and thus not have an equality function == that could be called on it like i32 does. Since we only used == inside of specifications, we can fix this problems by using snapshot equality === instead. Here you can see where some of the changes were done (expand to see the full changes): # // The next line is only required for doctests, you can ignore/remove it
