The macros prusti_assert!, prusti_assert_eq! and prusti_assert_ne! instruct Prusti to verify that a certain property holds at a specific point within the body of a function. In contrast to the assert!, assert_eq! and assert_ne! macros, which only accept Rust expressions, the Prusti variants accept specification expressions as arguments. Therefore, quantifiers , old expressions and other Prusti specification syntax is allowed within a call to prusti_assert!, as in the following example: # // The next line is only required for doctests, you can ignore/remove it
