Quantifiers are typically used for describing how a method call changes a container such as a vector: # use prusti_contracts::*;
# #[requires(0 <= index && index < self.len())]
#[ensures(self.len() == old(self.len()))]
#[ensures(self.lookup(index) == value)]
#[ensures( forall(|i: usize| (0 <= i && i < self.len() && i != index) ==> (self.lookup(i) == old(self.lookup(i))) )
)]
pub fn store(&mut self, index: usize, value: i32) { // ...
} There may be multiple bound variables: forall(|x: isize, y: isize| ...) The syntax of universal quantifiers is: forall(|<bound variable>: <bound variable type>, ...| <filter> ==> <expression>) and the syntax of existential ones: exists(|<bound variable>: <bound variable type>, ...| <expression>)
